import React from 'react'
import "../styles.css";

const LikedQuote = () => {
    return (
        <div className="quote__block">
        <h1 className="quote__text">{value.quote}</h1>
        <h3 className="quote__author">- {value.author}</h3>
    </div>
    )
}

export default LikedQuote
